El Cuarteto para el Diálogo Nacional en Túnez (en árabe: رباعية الحوار الوطنى التونسى: رباعية الحوار الوطنى التونسى‎, frotaāʿiyyat al-ḥiwār al-waṭunī en-tūnisī) es un grupo compuesto por cuatro organizaciones de la sociedad civil que ha sido clave para que Túnez haya avanzado hacia un sistema político de democracia plural tras la revolución tunecina en 2011. El Cuarteto para el Diálogo Nacional comprende las siguientes organizaciones: 
*  la Unión General Tunecina del Trabajo; 
*  la Unión Tunecina de la Industria, el Comercio y la Artesanía; 
*  la Liga Tunecina de los Derechos Humanos; y 
*  la Orden Nacional de los Abogados de Tunicia. En 2015, el cuarteto fue galardonado con el premio Nobel de la Paz.
